import React from "react";

export const ContactForm = ({
  name,
  setName,
  phone,
  setPhone,
  email,
  setEmail,
  handleSubmit
}) => {
  return (
    <div>
      <form onSubmit={handleSubmit}>

        <label for="text">Enter your Name:</label>
        <input type="text" id="text" placeholder="Full Name" style={{display: "block", width : "30vw", margin: "10px"}} required />

        <br/>

        <label for="tel">Enter your Phone:</label>
        <input type="tel" id="tel" placeholder="Phone Number" style={{display: "block", width : "30vw", margin: "10px"}} required />

        <br/>

        <label for="email">Enter your E-Mail:</label>
        <input type="email" id="email" placeholder="E-Mail" style={{display: "block", width : "30vw", margin: "10px"}} required />

        <br />

        <input type="button" value="Add New Contact" style={{display: "block", width : "30vw", margin: "10px", backgroundColor: "green"}}/>

      </form>
    </div>
  );
};
